With the following syntax, you can insert runnable Rust files into your book: {{#playpen file.rs}} The path to the Rust file has to be relative from the current source file. When play is clicked, the code snippet will be sent to the Rust Playpen to be compiled and run. The result is sent back and displayed directly underneath the code. Here is what a rendered code snippet looks like: fn main() { let x = add_one(2); assert_eq!(x, 3);
} fn add_one(num: i32) -> i32 { num + 1
}
